import axios from "axios";

class LoginService{
    async signIn(email :string, password: string) {
        return axios
            .post("https://sklep-backend.azurewebsites.net/api/signIn", {
                email,
                password,
            })
            .then((response) => {
                document.cookie = `role=${response.data.role}; path=/`;
                document.cookie = `email=${response.data.email}; path=/`;
            });
    }

    signUp(email :string, firstName :string, lastName :string, password :string) {
        return axios.post("http://localhost:9000/api/signUp", {
            email: email,
            password: password,
            firstName: firstName,
            lastName: lastName,
        });
    }

